import React from 'react';
import NavBar from "./NavBar";
import movies from "../media/movies.jpg";

const Header = () => {
    return (
        <div className = "header">
            <img src={movies} alt ="picture movies" />
            <NavBar />
        </div>
    );
};

export default Header;
